      }
    });
    return flag;
  }

  update(name, value) {
    const config = this.cfg;
    config[ATTR_MAP[name]] = value;
    this._parseShadow(config, this.el);
    return this;
  }

  _parseShadow(config, el) {
    const child = `<feDropShadow
      dx="${config.dx || 0}"
      dy="${config.dy || 0}"
      stdDeviation="${config.blur ? config.blur / 10 : 0}"
      flood-color="${config.color ? config.color : '#000'}"
      flood-opacity="${config.opacity ? config.opacity : 1}"
      />`;
    el.innerHTML = child;
  }
}

export default Shadow;

/**
 * @fileoverview arrow
 * @author dengfuping_develop@163.com
 */

import { isArray, uniqueId } from '@antv/util';

class Arrow {
  id: string;
  el: SVGMarkerElement;
  child: SVGPathElement | any; // TODO G.Shape, not any
  stroke: string;
  cfg: {
    [key: string]: any;
  } = {};

  constructor(attrs, type) {
    const el = document.createElementNS('http://www.w3.org/2000/svg', 'marker');
    const id = uniqueId('marker_');
    el.setAttribute('id', id);
    const shape = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    shape.setAttribute('stroke', attrs.stroke || 'none');
    shape.setAttribute('fill', attrs.fill || 'none');
    el.appendChild(shape);
    el.setAttribute('overflow', 'visible');
    el.setAttribute('orient', 'auto-start-reverse');
    this.el = el;
    this.child = shape;
    this.id = id;
    const cfg = attrs[type === 'marker-start' ? 'startArrow' : 'endArrow'];
    this.stroke = attrs.stroke || '#000';
    if (cfg === true) {
      this._setDefaultPath(type, shape);
    } else {
      this.cfg = cfg; // when arrow config exists
      this._setMarker(attrs.lineWidth, shape);
    }
    return this;
  }

  match() {
    return false;
  }

  _setDefaultPath(type, el) {
    const parent = this.el;
    //  10 60 
    el.setAttribute('d', `M0,0 L${10 * Math.cos(Math.PI / 6)},5 L0,10`);
    parent.setAttribute('refX', `${10 * Math.cos(Math.PI / 6)}`);
    parent.setAttribute('refY', `${5}`);
  }

  _setMarker(r, el) {
    const parent = this.el;
    let path = this.cfg.path;
    const d = this.cfg.d;

    if (isArray(path)) {
      path = path
        .map((segment) => {
          return segment.join(' ');
        })
        .join('');
    }
    el.setAttribute('d', path);
    parent.appendChild(el);
    if (d) {
      parent.setAttribute('refX', `${d / r}`);
    }
  }

  update(fill) {
    const child = this.child;
    if (child.attr) {
      child.attr('fill', fill);
    } else {
      child.setAttribute('fill', fill);
    }
  }
}

export default Arrow;

/**
 * @fileoverview clip
 * @author dengfuping_develop@163.com
 */

import { uniqueId } from '@antv/util';

class Clip {
  type: string = 'clip';
  id: string;
  el: SVGClipPathElement;
  cfg: {
    [key: string]: any;
  } = {};

  constructor(cfg) {
    const el = document.createElementNS('http://www.w3.org/2000/svg', 'clipPath');
    this.el = el;
    this.id = uniqueId('clip_');
    el.id = this.id;
    const shapeEl = cfg.cfg.el;
    el.appendChild(shapeEl);
    this.cfg = cfg;
    return this;
  }

  match() {
    return false;
  }

  remove() {
    const el = this.el;
    el.parentNode.removeChild(el);
  }
}

export default Clip;

/**
 * @fileoverview pattern
 * @author dengfuping_develop@163.com
 */

import { uniqueId } from '@antv/util';

const regexPR = /^p\s*\(\s*([axyn])\s*\)\s*(.*)/i;

class Pattern {
  el: SVGPatternElement;
  id: string;
  cfg: {
    [key: string]: any;
  } = {};

  constructor(cfg) {
    const el = document.createElementNS('http://www.w3.org/2000/svg', 'pattern');
    el.setAttribute('patternUnits', 'userSpaceOnUse');
    const child = document.createElementNS('http://www.w3.org/2000/svg', 'image');
    el.appendChild(child);
    const id = uniqueId('pattern_');
    el.id = id;
    this.el = el;
    this.id = id;
    this.cfg = cfg;
    const arr = regexPR.exec(cfg);
    const source = arr[2];
    child.setAttribute('href', source);
    const img = new Image();
    if (!source.match(/^data:/i)) {
      img.crossOrigin = 'Anonymous';
    }
    img.src = source;
    function onload() {
      el.setAttribute('width', `${img.width}`);
      el.setAttribute('height', `${img.height}`);
    }
    if (img.complete) {
      onload();
    } else {
      img.onload = onload;
      // Fix onload() bug in IE9
      img.src = img.src;
    }

    return this;
  }

  match(type, attr) {
    return this.cfg === attr;
  }
}

export default Pattern;
